// src/pages/FeedbackPage.jsx
import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function FeedbackPage() {
  const location = useLocation();
  const navigate = useNavigate();
  const feedbacks = location.state?.feedbacks || [];

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: 'auto' }}>
      <h1>Hasil Feedback Jawaban Kamu</h1>

      {feedbacks.length === 0 ? (
        <p>Tidak ada feedback yang tersedia.</p>
      ) : (
        feedbacks.map((fb, idx) => (
          <div key={idx} style={{
            backgroundColor: '#f4f4f4',
            borderRadius: '8px',
            padding: '15px',
            marginBottom: '10px'
          }}>
            <p><strong>Pertanyaan:</strong> {fb.question}</p>
            <p><strong>Feedback:</strong> {fb.feedback_text}</p>
          </div>
        ))
      )}

      <button
        onClick={() => navigate('/')}
        style={{
          marginTop: '20px',
          padding: '10px 20px',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '8px',
          cursor: 'pointer'
        }}
      >
        Kembali ke Simulasi
      </button>
    </div>
  );
}

export default FeedbackPage;
